import React from "react";

import './style.css';

import { Col, Container, Row } from 'react-bootstrap';

function Tester() {

  const ArraysOfCard = [{}];
  const ArraysOfCardOnMap = ArraysOfCard.map((ArrayOfCard) => 
  <Col lg = "4" md = "6" sm = "12">
    <div className = "card-wrapper">
      <h1>Математика</h1>
      <h4>Высота: {ArrayOfCard.height}</h4>
      <h4>Ширина: {ArrayOfCard.width}</h4>
      <h3>Площадь: {ArrayOfCard.size}</h3>
    </div>
  </Col>
  )

  return (
    <>
    <Container fluid>
      <Row>
        {ArraysOfCardOnMap}
      </Row>
    </Container>
    </>
  );
}

export default Tester;
